.
SO September is all about training for that event in Nottinghamshire. Today I just did one cycle on my bucket list which formed part of my training which was to cycle from my Greenwich home to my West Sussex home home. It was 66k and took me 3.5 hours via Croydon and Reigate. The first part of the London route wasn’t ideal and at one point I ended up walking up a hill in a field in my cleats! Certainly an adventure. 
.
